function App() {
  return (
  <Box sx={{
backgroundColor : '#E3FFEE', 
height : '100vh',
display : 'flex',
flexDirection: 'column',
alignItems:'center',
padding:1

  }}>

<Typography variant="h1" gutterBottom sx={{color:'#002B40',
margin:5
}}>
  What does this company do ?
</Typography>

<TextField id="outlined-basic" label="Enter Website URL" variant="outlined" sx={{color:'#002B40',
width:'80%'}}>
  </TextField>

<Stack spacing={2} direction="row" >

<Button variant="contained">Summarize</Button>
<Button variant="contained">Roast</Button>
</Stack>

  </Box>


  );
}

export default App;
